INSERT INTO `forma2_publishs` (`id`, `title`, `data`, `type`, `thumbnail`, `tags`, `category`, `piloto`, `author`, `fcreate`, `fchange`, `trash`, `public`) VALUES
	(1, 'Redes inalámbricas y sus conceptos', '<p><span style="color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, sans-serif, arial; font-size: 13px; background-color: rgb(255, 255, 0);" data-mce-style="color: #000000; font-family: &#039;Open Sans&#039;, sans-serif, arial; font-size: 13px; background-color: #ffff00;">Cuando quieres configurar una red inalámbrica en casa y miras el router de tú ADSL y después el Ordenador, empiezas a tener un montón de dudas por la cantidad de conceptos y nomenclaturas diferentes que existe en dicho tipo de comunicaciones. Lo primero a explicar para despejar todas las incógnitas, son las abreviaturas utilizadas en las redes inalámbricas y a la vez comprender ese mundo apasionante de las redes por rutas aéreas.</span></p><h1><span style="color: #333333;" data-mce-style="color: #333333;">Los primeros conceptos son:</span></h1><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>WAN :</strong>&nbsp;Una Red de Área Amplia (Wide Area Network o WAN, del inglés). Es una red de Ordenadores gran tamaño, generalmente dispersa en un área metropolitana, a lo largo de un país o incluso a nivel planetario. La red WAN más amplia es Internet. Las redes WAN a parte del cable pueden usar sistemas de comunicación vía satélite o de radio<strong>.</strong></span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;">Fue la aparición de los portátiles y los PDA la que trajo el concepto de redes inalámbrica y un poco de confusión por parecerse las palabras WAN y WLAN al mundo de las redes inalámbricas.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>WLAN</strong>&nbsp;(en inglés;&nbsp;<em>Wireless Local Area Network</em>) es un sistema de comunicación de datos inalámbrico , muy utilizado como alternativa a las redes LAN cableadas o como extensión de éstas. Utiliza tecnología de radiofrecuencia que permite mayor movilidad a los usuarios al minimizar las conexiones cableadas.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;">A nivel de redes domesticas el router de ADSL tiene varias luces (Ethernet, WLAN, Encendido, ADSL y Alerta). La luz WLAN si está encendida nos indica la activación de las comunicaciones inalámbricas en el router. Si la luz WLAN está apagada, necesitamos leer el manual de instrucciones del fabricante y ver cómo se activa la WLAN o comunicaciones inalámbricas en el router ADSL. Generalmente se activa en el router con un botón que indica reset.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><br></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>LAN :</strong>&nbsp;Una red de área local, es la interconexión de varios ordenadores y periféricos de no más de 100 Metros. Su aplicación más extendida es la interconexión de ordenadores personales y estaciones de trabajo en oficinas, fábricas, etc., para compartir recursos e intercambiar datos y aplicaciones. En definitiva, permite que dos o más máquinas se comuniquen por cable o inalámbrico.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><br></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>WIRELESS :</strong>&nbsp;Son dispositivos que soportan comunicaciones inalámbricas, en las que se utilizan modulación de ondas electromagnéticas, radiaciones o medios ópticos. Estás se propagan por el espacio vacío sin medio físico que comunique cada uno de los extremos de la transmisión.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;">Para las redes domesticas son todos aquellos dispositivos catalogados como WIRELESS en las tiendas de informática para poder conectar vía red LAN inalámbrica con otros dispositivos WIRELESS y con la WLAN del router de la ADSL de Internet.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>Wifi :&nbsp;</strong>Es una abreviatura de Wireless Fidelity, es un conjunto de estándares para redes inalámbricas basado en las especificaciones IEEE 802.11.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;">Existen diversos tipos de&nbsp;<strong>Wi-Fi</strong>, y son los siguientes:</span></p><ul style="margin-bottom: 10px; color: #333333; font-family: &#039;Open Sans&#039;, sans-serif, arial; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-bottom: 10px; color: #333333; font-family: &#039;Open Sans&#039;, sans-serif, arial; font-size: 13px; background-color: #ffffff;"><li><span style="color: #333333;" data-mce-style="color: #333333;">Los estándares&nbsp;IEEE 802.11b&nbsp;e IEEE 802.11g disfrutan de una aceptación internacional debido a que la banda de 2.4 GHz está disponible casi universalmente, con una velocidad de hasta 11 Mbps y 54 Mbps, respectivamente (Dispositivos wireless).</span></li><li><span style="color: #333333;" data-mce-style="color: #333333;">En la actualidad ya se maneja también el estándar IEEE 802.11a, conocido como WIFI 5, que opera en la banda de 5 GHz para las tecnologías (Bluetooth, microondas, ZigBee, WUSB). Su enlace es algo menor que el de los estándares que trabajan a 2.4 GHz (un 10% a mayor frecuencia, menor alcance).</span></li></ul><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>Todo lo explicado sirve para conectar todos los dispositivos entre sí, sin necesidad de utilizar cables entre ellos. Dicha tecnología nos da una cobertura y movilidad de dispositivos total en nuestra casa.</strong></span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><br></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;">Pero sigamos aprendiendo más sobre las abreviaturas, ahora nos centramos en los tipos de acceso entre dispositivos y encriptaciones de datos.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>SSID</strong>&nbsp;(Service Set Identifier) : Es para identificar y nombrar la red WAN. Cuando activamos la WLAN en el router, después configuramos sus parámetros y uno de ellos es el nombre de la red inalámbrica a identificar por nuestros dispositivos (PC y Puntos de Acceso).</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;">Las redes inalámbricas pueden verse desde el exterior, sólo buscando los SSID existentes en el aire, podemos conectar un Ordenador con nuestra propia red inalámbrica, o con otras redes vecinas cercanas a nuestra red LAN.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;">Para garantizar la no conexión de otros dispositivos externos en nuestras redes inalámbricas, existe la autentificación y aceptación de dichos dispositivos a la red LAN y WLAN del router. Si no estás bien autentificado, la Red inalámbrica rechazara dicho dispositivo y no lo dejara entrar a la red LAN.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;">Para complicar aún más todo este mundillo , existen diferentes métodos de autentificación (PSK, IEEE 802.X, Por Usuario, Certificados y libres)</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;">Las autentificaciones (IEEE 802.1X y Certificados) son para empresas y no las vamos a explicar en dicho artículo. Vamos a explicar las utilizadas en redes domesticas y son:</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><br></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>PSK :</strong>&nbsp;Claves pre-compartidas :Un método que realiza claves creadas manualmente y estáticas, utiliza el que configura la red inalámbrica para identificarse a un Ordenador PSK. También funciona como encriptación.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>Por Usuario :</strong>&nbsp;Configurar nuestra red inalámbrica con un nombre de usuario y contraseña.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>Libre :</strong>&nbsp;Existe la posibilidad de entrar a la red sin autentificaciones por parte de ningún dispositivo a la red inalámbrica. Todos vosotros pensaréis que dicha opción nunca se utilizara, pero estáis muy equivocados. Cuando estamos configurando la red inalámbrica y existen problemas de conectabilidad, es necesario durante un cierto tiempo abrir la red para poder ir descartando opciones y poder averiguar dónde está el problema de conexión entre los dispositivos.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;">Una vez identificado el tipo de autentificación a utilizar, cambiamos la configuración de la política de seguridad y la encriptación de la información.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>WEP</strong>&nbsp;(Protocolo Equivalente Alámbrico): es un código de seguridad usado para codificar los datos transmitidos sobre una red inalámbrica. El WEP tiene tres configuraciones: Off (ninguna seguridad), 64-bit (seguridad débil), 128-bit (seguridad algo mejor). El WEP usa cuatro claves de cifrado que pueden ser cambiados periódicamente para hacer más difícil la interceptación del tráfico. Todos los dispositivos en la red deben usar la misma codificación (claves).</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>WPA</strong>&nbsp;(Acceso Protegido Wi-Fi) es un nivel más alto de seguridad que el WEP que combina la codificación y la autentificación para crear un nivel inquebrantable de protección. Una WPA-PSK (clave compartida en WPAPm) es configurada para cada dispositivo de red, para que los paquetes enviados sobre una red inalámbrica sean codificados usando TKIP (Protocolo de Integridad de Clave Temporal). o EAS (Estándar de cifrado avanzado).</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>Dirección MAC :</strong>&nbsp;Es un control de acceso de medios que cada adaptador, cada tarjeta de interfaz de red, ha grabado en el hardware. Es único, los puntos de acceso o el router pueden tener una tabla de estas direcciones y permitir que se conecte únicamente esta tarjeta de interfaz de red.</span></p><p style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-top: 0px; margin-bottom: 10px; font-family: &#039;Open Sans&#039;, sans-serif, arial; color: #333333; font-size: 13px; background-color: #ffffff;"><span style="color: #333333;" data-mce-style="color: #333333;"><strong>RESUMEN</strong></span></p><ul style="margin-bottom: 10px; color: #333333; font-family: &#039;Open Sans&#039;, sans-serif, arial; font-size: 13px; background-color: #ffffff;" data-mce-style="margin-bottom: 10px; color: #333333; font-family: &#039;Open Sans&#039;, sans-serif, arial; font-size: 13px; background-color: #ffffff;"><li><span style="color: #333333;" data-mce-style="color: #333333;">Las Redes LAN es la conexión entre dispositivos y el router dentro de nuestro domicilio (Casa o Empresa).</span></li><li><span style="color: #333333;" data-mce-style="color: #333333;">Las Redes WAN es la conexión desde el router ADSL hacia el mundo exterior.</span></li><li><span style="color: #333333;" data-mce-style="color: #333333;">Las abreviaturas WLAN, WIRELESS, WI-FI, SSID, WEP y WPA se identifican para redes inalámbrica.</span></li><li><span style="color: #333333;" data-mce-style="color: #333333;">Para conectar un PC a una red inalámbrica necesitamos un dispositivo Wireless que soporte los estándares IEEE 802.11b y 802.11g. Dichos estándares siempre están indicados en las cajas de dichos productos cuando se ponen a la venta.</span></li><li><span style="color: #333333;" data-mce-style="color: #333333;">Las redes inalámbricas son más inseguras que las de cable, pero a la vez son necesarias en ciertos entornos con una gran movilidad o costosa inversión a nivel de infraestructura de cableado. Por ejemplo, desierto, pozos petrolíferos, ciudades, barrios, hospitales, castillos, museos, universidades …………..</span></li><li><span style="color: #333333;" data-mce-style="color: #333333;">De todas las políticas de seguridad, la más segura es la WPA-PSK, pero algunos de tus dispositivos wireless no lo soporten y no tengas conexíón con los enlaces o la WLAN del router.</span></li><li><span style="color: #333333;" data-mce-style="color: #333333;">La política de seguridad más utilizada por ser soportada por todos los dispositivos WIRELESS es la WEP de 64 bit 0 128 bit. y a la vez es posible hackearla</span></li><li><span style="color: #333333;" data-mce-style="color: #333333;">Pero es mejor leer el manual de Hackear redes wifi realizados por ellos mismos y su dirección es :&nbsp;Foro del hacker WI-FI</span></li></ul>', 'articles', 1, 'Wifi, Wireless, Wlan, Lan, Wan, SSID, Wep, Wpa', 1, 1, '00000000000000000000000000000001', '2017-12-05 03:20:27', '2018-10-25 15:36:31', 0, 1),
	(2, 'Banner1', '<div id="cmain" class="comment"><div class="header">[2 Mar 2007 15:54] Olaf van der Spek</div><pre class="note"><strong>Description:</strong>\nIt seems blob/text colums can&#039;t have a default value, not even the empty string. This causes a problem in strict mode, as you then have to explicitly insert the empty string each time, which shouldn&#039;t be necessary.\n\n<strong>How to repeat:</strong>\nServer version: 5.1.16-beta-community-nt MySQL Community Server (GP\n\nmysql&gt; create table a (b blob not null, c int);\nQuery OK, 0 rows affected (0.00 sec)\n\nmysql&gt; insert into a (c) values (1);\nERROR 1364 (HY000): Field &#039;b&#039; doesn&#039;t have a default value\nmysql&gt; insert into a (b, c) values (&#039;&#039;, 1);\nQuery OK, 1 row affected (0.00 sec)\n\nmysql&gt; alter table a change b b blob not null default &#039;&#039;;\nERROR 1101 (42000): BLOB/TEXT column &#039;b&#039; can&#039;t have a default value\nmysql&gt;</pre></div><div id="c106986" class="comment"><div class="header">[2 Mar 2007 15:59] Victoria Reznichenko</div><pre class="note">Hello Olaf,\n\nThank you for the report but this is not a bug. BLOB and TEXT column can not have default values.\n<a href="http://dev.mysql.com/doc/refman/5.0/en/blob.html" data-mce-href="http://dev.mysql.com/doc/refman/5.0/en/blob.html">http://dev.mysql.com/doc/refman/5.0/en/blob.html</a></pre></div><div id="c106987" class="comment"><div class="header">[2 Mar 2007 16:03] Olaf van der Spek</div><pre class="note">Could you please read the rest of my report?</pre></div><div id="c106988" class="comment"><div class="header">[2 Mar 2007 16:05] Olaf van der Spek</div><pre class="note">Just to clarify, this is basically a request to at least allow the empty string as default for blob/text columns.</pre></div><div id="c107022" class="comment"><div class="header">[2 Mar 2007 19:31] Sergei Golubchik</div><pre class="note">Isn&#039;t it a regression ?</pre></div><div id="c107135" class="comment"><div class="header">[3 Mar 2007 19:51] Valeriy Kravchuk</div><pre class="note">This is not a regression, as, at least according to older manual (<a href="http://dev.mysql.com/doc/refman/4.1/en/blob.html" data-mce-href="http://dev.mysql.com/doc/refman/4.1/en/blob.html">http://dev.mysql.com/doc/refman/4.1/en/blob.html</a>) any default values were not allowed for BLOB/TEXT columns.\n\nAs this is clearly described in the manual, I can not call it a bug, formally. It is a reasonable feature request (to allow &#039;&#039; as default value for NOT NULL BLOB/TEXT column), though.</pre></div><div id="c188764" class="comment"><div class="header">[5 Oct 2008 10:59] Konstantin Osipov</div><pre class="note">This is a duplicate of <a href="https://bugs.mysql.com/bug.php?id=21532" data-mce-href="https://bugs.mysql.com/bug.php?id=21532">Bug#21532</a></pre></div><div id="c463569" class="comment"><div class="header">[18 Aug 2017 7:53] KaungMyat ChanThar</div><pre class="note">I am facing the same issue :(</pre></div>', 'articles', 4, 'sin etiquetas', 2, 1, '00000000000000000000000000000001', '2018-10-25 16:40:13', '2018-10-25 16:50:46', 0, 1),
	(3, 'Nuevo Banner', 'Escribe aquì el contenido del articulo o el link del banner.', 'ecards', 5, 'sin etiquetas', 2, 1, '00000000000000000000000000000001', '2018-10-25 16:43:27', '2018-10-25 16:50:48', 0, 1);
